import React from "react";


const CatalogoItem = () => {
    return(
        <div className="col-md-4 mb-4">
            {videojuegos.map(videojuego => (
                <VideojuegoItem key={videojuego.id} videojuego={videojuego} />
            ))}
        </div>
    );
};

export default CatalogoItem;
